import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import { styled } from '@mui/material/styles';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
    [`&.${tableCellClasses.head}`]: {
        color: theme.palette.common.white,
        fontSize: 14,
        padding: 5,
    },
    [`&.${tableCellClasses.body}`]: {
        backgroundColor: theme.palette.grey['300'],
        fontSize: 12,
    },
    // padding: 0,
    border: "1px solid gray",
}));

export default function WorkInício(props) {
    return (
        <TableContainer>
            <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
                <TableHead>
                    <TableRow>
                        <StyledTableCell style={{ backgroundColor: "rgb(0,0,50)" }} align="center" colSpan={2}>Monday</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "rgb(0,0,50)" }} align="center" colSpan={2}>Tuesday</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "rgb(0,0,50)" }} align="center" colSpan={2}>Wednesday</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "rgb(0,0,50)" }} align="center" colSpan={2}>Thursday</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "rgb(0,0,50)" }} align="center" colSpan={2}>Friday</StyledTableCell >
                    </TableRow>
                    <TableRow>
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Início</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Fim</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Início</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Fim</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Início</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Fim</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Início</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Fim</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Início</StyledTableCell >
                        <StyledTableCell style={{ backgroundColor: "#09084c" }} align="center">Fim</StyledTableCell >
                    </TableRow>
                </TableHead>
                <TableBody>
                    {
                        <TableRow>
                            {Object.entries(props.begin).map((day) => (
                                <StyledTableCell align="center">{day[1]}</StyledTableCell >
                            ))}
                            {Object.entries(props.finish).map((day) => (
                                <StyledTableCell align="center">{day[1]}</StyledTableCell >
                            ))}
                        </TableRow>
                    }
                </TableBody>
            </Table>
        </TableContainer>
    );
}
